			showTimeout: true,
			stopGameplay: false,
		};

		//PLAYER 
		adshandler.gameplay.playerConf = {
			name: "Baracuda!",
			color: 0x00ff00
		};

		//BOTS 
		adshandler.gameplay.botsCount = 5; // nb of bots
		adshandler.gameplay.botsSpeed = 12;
		adshandler.gameplay.botsConf = [
			{ name: "Mr Blue", color: 0x0000FF },
			{ name: "Mr Yellow", color: 0XFFFF00 },
			{ name: "Pacman", color: 0xFF0000 },
			{ color: 0x444444 },
		];


		//Misc params
		adshandler.gameplay.eatHolePoints = 5;
		adshandler.gameplay.resurrectionDelay = 3;

		function showMenu() {
			let div = document.createElement("div");
			div.className = "gbutton";
			div.style.zIndex = "11";
			div.style.position = "absolute";
			div.style.bottom = "20px";
			div.style.left = "20px";
			div.style.padding = "10px";
			div.style.borderRadius = "3px";
			div.style.backgroundColor = "#80deea";

			div.innerHTML = "START";
			document.body.appendChild(div);
			div.onclick = function () {
				adshandler.start();
			}
		}

		showMenu();
	</script>
